import { Card } from "react-bootstrap";

export default function Publicacion({ publicacion }) {
  const { alt, url, photographer, avg_color } = publicacion;
  console.log(publicacion);
  return (
    <Card style={{ background: avg_color }} className="text-dark">
      <Card.Img variant="top" src={url} />
      <Card.Body>
        <Card.Title>{alt}</Card.Title>
        <Card.Text>{photographer}</Card.Text>
      </Card.Body>
    </Card>
  );
}
